        static ReadSymm RetriveTransformation(string s)
        {
            ReadSymm rs = new ReadSymm();
            rs.pos1 = new int[3];
            rs.sign1 = new int[3];
            rs.pos2 = new int[3];
            rs.sign2 = new int[3];
            rs.shift = new float[3];

            var result = Regex.Replace(s, @"[\d+/]", string.Empty);

            if (result.Length == 0)
                return rs;

            string[] splits = result.Split(',');

            for (int i = 0; i < 3; i++)
            {
                rs.sign1[i] = 0;
                rs.sign2[i] = 0;
                rs.pos1[i] = -1;
                rs.pos2[i] = -1;

                #region tx part 1
                if (splits[i].Contains("x"))
                {
                    if (rs.pos1[i] == -1) rs.pos1[i] = 0;//xy
                    else rs.pos2[i] = 0;//xy

                    if (splits[i].Contains("-x"))
                        if (rs.pos2[i] == -1) rs.sign1[i] = -1;
                        else rs.sign2[i] = -1;
                    else
                        if (rs.pos2[i] == -1) rs.sign1[i] = 1;
                    else rs.sign2[i] = 1;
                }

                if (splits[i].Contains("y"))
                {
                    if (rs.pos1[i] == -1) rs.pos1[i] = 1;//xy
                    else rs.pos2[i] = 1;//xy

                    if (splits[i].Contains("-y"))
                        if (rs.pos2[i] == -1) rs.sign1[i] = -1;
                        else rs.sign2[i] = -1;
                    else
                        if (rs.pos2[i] == -1) rs.sign1[i] = 1;
                    else rs.sign2[i] = 1;
                }

                if (splits[i].Contains("z"))
                {
                    rs.pos1[i] = 2;//xy
                    if (splits[i].Contains("-z"))
                        rs.sign1[i] = -1;
                    else
                        rs.sign1[i] = 1;
                }

                if (rs.pos1[i] == -1) rs.pos1[i] = 0;
                if (rs.pos2[i] == -1) rs.pos2[i] = 0;
                #endregion
            }



            //////////////////////////////////////////////////////////////
            //retrive vector
            /////////////////////////////////////////////////////////////

            result = Regex.Replace(s, @"[A-Za-z+-]", string.Empty);

            splits = result.Split(',');

            for (int i = 0; i < 3; i++)
            {
                if (splits[i] == "")
                    rs.shift[i] = 0;
                else
                {
                    string[] splits2 = splits[i].Split('/');
                    rs.shift[i] = Int16.Parse(splits2[0]);
                    int ir = Int16.Parse(splits2[1]);
                    if (ir > 0)
                        rs.shift[i] /= ir;
                }
            }

            return rs;
        }

        static int Sign(char s)
        {
            int sign = 1;

            if (s == '-')
            {
                sign = -1;
            }

            return sign;
        }

        static void Asign_xyz(ref List<int> a, char s, int sign, ref int j)
        {

            if (s == 'x') { a.Add(sign); j++; }
            if (s == 'y') { a.Add(sign); j++; }
            if (s == 'z') { a.Add(sign); j++; }

        }

        public static void CreateTransformations(int group)
        {

            if (Cif.SymmetryOperations.Count > 0) return;
            if (group < 1) return;

            SMatrix.Clear();

            if (group == 0)
            {
                ReadSymm readSymm = new ReadSymm();

                int[] sign1 = new int[3];
                int[] sign2 = new int[3];
                int[] pos1 = new int[3];
                int[] pos2 = new int[3];
                float[] shift = new float[3];

                readSymm.pos1 = pos1;
                readSymm.pos2 = pos2;
                readSymm.shift = shift;

                sign1[0] = 1; sign1[1] = 0; sign1[2] = 1;
                readSymm.sign1 = sign1;
                readSymm.sign2 = sign2;

                SMatrix.Add(readSymm);
                return;
            }


            if (group > 230) group = 1;


            group_number = group;

                                                                                                                                                                         string[] value = SymmetryOperations[group];//Get the symmetry operations from the list

            //Clear the lists
            SMatrix.Clear();
       

            //Fill the vector and matrix table with elememts
            for (int element = 3; element < value.Count(); element++)//
            {
                SMatrix.Add(RetriveTransformation(value[element]));
            }
        }
        public static void TransformationsClean()
        {
            SMatrix.Clear();
        }
        public static void CreateTransformationsFromFile(string value)
        {
            string modifiedString = value.Replace(" ", "").Replace("'", "").Replace("`", "").Replace("'", "").Replace("`", "");
            SMatrix.Add(RetriveTransformation(modifiedString));
        }

        public static string RetriveSystem(int index)
        {
            string system;
            string[] value = SymmetryOperations[index];
            system = value[1];

            return system;
        }
